import os
import io
import qrcode
from PIL import Image
import base64
import matplotlib.pyplot as plt

# Generate random bytes
length_of_base64_data = 20
random_bytes = os.urandom(length_of_base64_data)

# Encode random bytes as base64
base64_data = base64.b64encode(random_bytes).decode("utf-8")
print(f"base64_data: {base64_data}")

ascii_string = "Hello, Ursa!"
base64_data = base64.b64encode(ascii_string.encode('ascii'))

print(f"ascii_string: {ascii_string}")


# Convert base64 data to bytes
binary_data = base64.b64decode(base64_data)

# Create a QR code instance
qr = qrcode.QRCode(
    version=None,
    error_correction=qrcode.constants.ERROR_CORRECT_L,
    box_size=10,
    border=4,
)

# Add data to the QR code
qr.add_data(base64_data)
qr.make(fit=True)

# Create an image of the QR code
qr_image = qr.make_image(fill_color="black", back_color="white")

# Save or display the QR code image
qr_image.save("base64_to_qr.png")

# Convert the QR code image to bytes
image_bytes = io.BytesIO()
qr_image.save(image_bytes, format="PNG")
image_bytes = image_bytes.getvalue()

# Load the QR code image using PIL
qr_pil_image = Image.open(io.BytesIO(image_bytes))

# Display the QR code using matplotlib
plt.imshow(qr_pil_image)
plt.axis('off')  # Hide axes
plt.show()



# Load the QR code image
qr_image = Image.open("base64_to_qr.png")

# Convert the image to bytes
image_bytes = qr_image.tobytes()

# Encode the image bytes as base64
base64_data = base64.b64encode(image_bytes).decode("utf-8")

print("Base64 encoded QR code data:")
print(base64_data)

from pyzbar.pyzbar import decode  # This library is used to decode barcodes and QR codes

# Decode the QR code
decoded_objects = decode(qr_image)
for obj in decoded_objects:
    print("Type:", obj.type)

    decoded_data = obj.data.decode('utf-8')
    print("Decoded Base64 Data:", decoded_data)

    try:
        original_data = base64.b64decode(decoded_data)
        print("Decoded Original Data:", original_data)
        decoded_ascii = decoded_data.decode('ascii')
        print("decoded_ascii:", decoded_ascii)
    except Exception as e:
        print("Error decoding Base64 data:", e)


